    function withdrawAdmin() external payable onlyAdmin {
        uint256 amount = commissionEarned[admin];
        payable((msg.sender)).transfer(amount);
        commissionEarned[admin] = 0;
        winnerTax[admin] = 0;
        totalLotteryCreationFees[admin] = 0;
    }

    function withdrawrefereecommission() external payable {
        uint256 amount = refereeEarned[msg.sender];
        payable((msg.sender)).transfer(amount);
        refereeEarned[msg.sender] = 0;
    }

    function withdrawETH() external payable onlyAdmin {
        payable(msg.sender).transfer(address(this).balance);
    }

    function withdrawLink() external onlyAdmin {
        require(
            LINK.transfer(msg.sender, LINK.balanceOf(address(this))),
            "Unable to transfer"
        );
    }

    function updateFee(
        uint256 _lotteryCreateFee,
        uint256 _transferFeePerc,
        uint256 _tokenEarnPercent,
        uint256 _minroll,
        uint256 _rolloverday
    ) external onlyAdmin {
        lotteryCreateFee = _lotteryCreateFee;
        transferFeePerc = _transferFeePerc;
        tokenEarnPercent = _tokenEarnPercent;
        minimumRollover = _minroll;
        defaultRolloverday = _rolloverday;
    }

    function redeemTokens() external {
        require(
            tokenearned[msg.sender] <=
                IERC20(tokenAddress).balanceOf(address(this)),
            "low balance"
        );
        IERC20(tokenAddress).transfer(msg.sender, tokenearned[msg.sender]);
        tokenearned[msg.sender] = 0;
    }

    function transferToken(
        uint256 amount,
        address to,
        address tokenAdd
    ) external onlyAdmin {
        require(
            amount <= IERC20(tokenAdd).balanceOf(address(this)),
            "low balance"
        );
        IERC20(tokenAdd).transfer(to, amount);
    }

    function transferAdmin(address newAdmin) external onlyAdmin {
        require(newAdmin != address(0));
        admin = newAdmin;
    }

    function addEditPartnerDetails(
        string memory _name,
        string memory _logoHash,
        bool _status,
        string memory _websiteAdd,
        address _partnerAddress,
        uint256 _createdOn
    ) external {
        assert(_partnerAddress != address(0));
        if (partnerbyaddr[_partnerAddress].partnerAddress == address(0)) {
            partnerId++;
            partnerids[partnerId] = _partnerAddress;
            partnerbyaddr[_partnerAddress] = PartnerData({
                partnerId: partnerId,
                name: _name,
                logoHash: _logoHash,
                status: _status,
                websiteAdd: _websiteAdd,
                partnerAddress: _partnerAddress,
                createdOn: _createdOn
            });
        } else {
            partnerbyaddr[_partnerAddress] = PartnerData({
                partnerId: partnerbyaddr[_partnerAddress].partnerId,
                name: _name,
                logoHash: _logoHash,
                status: _status,
                websiteAdd: _websiteAdd,
                partnerAddress: _partnerAddress,
                createdOn: _createdOn
            });
        }
        emit PartnerCreated(
            _name,
            _logoHash,
            _status,
            _websiteAdd,
            _partnerAddress,
            block.timestamp
        );
    }
}

pragma solidity ^0.8.7;

// SPDX-License-Identifier: Unlicensed
import "@openzeppelin/contracts/utils/math/SafeMath.sol";

contract autobetUser {
    uint256 public bregisterFee = 10;
    address public admin;
    uint256 public ownerId = 1;
    using SafeMath for uint256;
    mapping(address => OwnerData) public organisationbyaddr;
    mapping(address => uint256) public amountEarned;
    mapping(address => uint256) public registrationFees;
    mapping(uint256 => address) public organisationbyid;

    //  constructor(address _tokenAddress);

    event OrganisationAdded(
        uint256 id,
        address owner,
        address referee,
        string name,
        string phoneno,
        uint256 dob,
        string email,
        string resiAddress,
        uint256 minPrize,
        uint256 maxPrize
    );
    modifier onlyowner() {
        require(organisationbyaddr[msg.sender].active, "Not a organisation");
        _;
    }

    constructor() {
        admin = msg.sender;
        organisationbyaddr[msg.sender] = OwnerData({
            id: ownerId,
            userAddress: msg.sender,
            referee: address(0),
            name: "Autobet",
            phoneno: "",
            dob: 0,
            resiAddress: "",
            email: "autobetlottery@gmail.com",
            active: true,
            minPrize: 0,
            maxPrize: 1 * 10**30
        });
        amountEarned[msg.sender] = 0;
        registrationFees[msg.sender] = 0;
        organisationbyid[ownerId++] = msg.sender;
    }

    modifier onlyAdmin() {
        require(admin == msg.sender, "not-a-admin");
        _;
    }

    function isCreator(address creatorAddress) public view returns (bool) {
        return organisationbyaddr[creatorAddress].active;
    }

    function getMinPrize(address creatorAddress) public view returns (uint256) {
        return organisationbyaddr[creatorAddress].minPrize;
    }

    function getCreatorId(address creatorAddress)
        public
        view
        returns (uint256)
    {
        return organisationbyaddr[creatorAddress].id;
    }

    function getMaxPrize(address creatorAddress) public view returns (uint256) {
        return organisationbyaddr[creatorAddress].maxPrize;
    }

    function getReferee(address creatorAddress) public view returns (address) {
        return organisationbyaddr[creatorAddress].referee;
    }

    function getCreatorAddress(address userAddress)
        public
        view
        returns (address)
    {
        return organisationbyaddr[userAddress].userAddress;
    }

    function getRegistrationFees(address _user)
        external
        view
        returns (uint256)
    {
        return registrationFees[_user];
    }

    struct OwnerData {
        bool active;
        address userAddress;
        address referee;
        string name;
        string phoneno;
        uint256 dob;
        string email;
        string resiAddress;
        uint256 id;
        uint256 maxPrize;
        uint256 minPrize;
    }

    function addOrganisation(
        address _owner,
        address _referee,
        string memory _name,
        string memory _phoneno,
        uint256 _dob,
        string memory _email,
        string memory _resiAddress,
        uint256 _minPrize,
        uint256 _maxPrize
    ) external payable {
        assert(_owner != address(0));
        uint256 median = (_minPrize + (_maxPrize)) / (2);
        uint256 fees = (median * bregisterFee) / (100);
        require(
            organisationbyaddr[_owner].userAddress == address(0),
            "Already registered"
        );
        require(fees == msg.value, "Register Fee not matching");
        organisationbyaddr[_owner] = OwnerData({
            id: ownerId,
            userAddress: _owner,
            name: _name,
            referee: _referee,
            resiAddress: _resiAddress,
            active: true,
            phoneno: _phoneno,
            dob: _dob,
            email: _email,
            minPrize: _minPrize,
            maxPrize: _maxPrize
        });
        amountEarned[_owner] = 0;
        registrationFees[admin] += msg.value;
        organisationbyid[ownerId++] = _owner;

        emit OrganisationAdded(
            ownerId,
            _owner,
            _referee,
            _name,
            _phoneno,
            _dob,
            _email,
            _resiAddress,
            _minPrize,
            _maxPrize
        );
    }

    function transferAdmin(address newAdmin) external onlyAdmin {
        require(newAdmin != address(0));
        organisationbyaddr[newAdmin] = organisationbyaddr[msg.sender];
        admin = newAdmin;
    }

    function updateMinMax(uint256 _minPrize, uint256 _maxPrize)
        public
        payable
        onlyowner
    {
        require(_maxPrize > 0, "Cant be below zero");
        require(_minPrize > 0, "Cant be below zero");
        uint256 median = ((_minPrize.add(_maxPrize)).mul(10**18)).div(2);
        uint256 fees = (median * bregisterFee).div(100);
        require(fees == msg.value, "Register Fee not matching");
        organisationbyaddr[msg.sender].minPrize = _minPrize;
        organisationbyaddr[msg.sender].maxPrize = _maxPrize;
        registrationFees[admin] += msg.value;
    }

    function withdrawRegisterationFees() external payable onlyAdmin {
        uint256 amount = registrationFees[admin];
        payable((msg.sender)).transfer(amount);
        registrationFees[admin] = 0;
    }
    
    function withdrawETH() external payable onlyAdmin {
        payable(msg.sender).transfer(address(this).balance);
    }
}

